export default function cleanSet(set, startString) {
  const valuesWithStartString = [...set].filter(value => value.startsWith(startString));
  const valuesWithoutStartString = valuesWithStartString.map(value => value.slice(startString.length));
  const finalString = valuesWithoutStartString.join('-');
  return finalString;
}

